import gulp, { dest } from "gulp";
import gpug from "gulp-pug";
import del from "del";
import WS from "gulp-webserver";
import image from "gulp-image";
import gSass, { logError } from "gulp-sass";

gSass.compiler = require("node-sass");
const routes = {
    pug:{
        src: "src/*.pug", //Ïï†Î•º Í∞êÏãúÌïòÎ©¥ Ï†úÎåÄÎ°ú ÏûëÎèôÏïàÌï® Í≥†Î°ú Î™®Îì† ÌååÏùºÏùÑ Í∞êÏãúÌï¥ÏïºÌï¥
        watch: "src/**/*.pug",
        dest:"goal"
    },
    scss:{
        watch:"src/scss/**/*.scss",
        src: "src/scss/style.scss",
        dest: "goal/css"

    },
    img: {
        src: "src/img/*",
        dest: "goal/img"
      }
   /* img:{
        src:"src/img/*",
        dest:"goal/img"
    }   */
};

const css = () => gulp.src(routes.scss.src).pipe(gSass().on("error",logError)).pipe(dest(routes.scss.dest));

const pug = () =>
  gulp
    .src(routes.pug.src)
    .pipe(gpug())
    .pipe(gulp.dest(routes.pug.dest));

const clear = () => del(["goal"]);

const webserver = () => gulp.src("goal/").pipe(WS({
    livereload: true,
    open: true
}));

const watchTarget = () =>{
    gulp.watch(routes.pug.watch,pug);
    gulp.watch(routes.img.src,img);
    gulp.watch(routes.scss.watch,css);

};

const watch_img = () => gulp.watch(routes.img.src.img);

const img = () =>
  gulp
    .src(routes.img.src)
    .pipe(image())
    .pipe(gulp.dest(routes.img.dest));

const imgOpt = () =>{
    gulp
    .src(routes.img.src)
    .pipe(image())
    .pipe(gulp.dest(routes.img.dest));} 
//ÏúÑÏóê Í≤ΩÏö∞ async ÏóêÎü¨ ÎÇ®, ÌôîÏÇ¥Ìëú Ìï®ÏàòÍ∞Ä {}Í∞êÏã∏Î©¥ this ÏÜçÏÑ±Ïù¥ Î≥ÄÌï® Ï£ºÏùòüòÇüòÇüòÇüòÇüòÇ

//ÎÇ¥Í∞Ä Ïª§Îß®Îìú Ìï†Í≤ÉÎßå export ÌïòÎ©¥Îåê
//imgÎäî Ïö©ÎüâÏù¥Ïª§ÏÑú ÏãúÍ∞Ñ ÎßéÏù¥ Ïû°ÏïÑÎ®πÏúºÎãàÍπå prepare sectionÏóêÏÑú ÏãúÌñâÏãúÌÇ§ÎäîÍ≤å ÎÇòÏùÑÎìØ, Í≥ÑÏÜç watchÎãπÌïòÎ©¥ ÎÑàÎ¨¥ ÎπÑÌö®Ïú®Ï†ÅÏûÑ
const prepare = gulp.series([clear,img]);
const live = gulp.parallel([webserver,watchTarget]); //ÎèôÏãú Ïã§Ìñâ
const assets =  gulp.series([pug,css]);


export const dev = gulp.series([prepare,assets,live]);
//export const enable_watch_img = gulp.series([watch_img]);

///Î¨∏Ï†ú, Ïù¥Ï†ú Ïó¨Í∏∞ÏÑ† reloadÍ∏∞Îä•Ïù¥ ÏïàÎ®πÌûò --> gulpÍ∞Ä ÎÇ¥ pugÌååÏùºÏùÑ Í∞êÏãúÏïàÌïòÍ∏∞ ÎïåÎ¨∏
